import React from 'react';
import { Link } from 'react-router-dom';

const ProjectBox = ({ title, description, githubLink }) => {
  return (
    <div className="project-box">
      <h2>{title}</h2>
      <p>{description}</p>
      <Link to={{pathname: "/project-details", state: {title, description, githubLink}}}>Learn more</Link>
    </div>
  );
};

export default ProjectBox;
